import * as React from "react";
import {Box, Grid, Typography } from "@mui/material";

function About() {
  return (
    <>
      <Box
        sx={{
          backgroundColor: "#ab47bc",
          width: "100%",
          height: "350px",
          display: "flex",
          justifyContent: "center",
        }}
      >
        <Grid
          container
          spacing={5}
          display="flex"
          justifyContent="space-evenly"
        ></Grid>
        
      </Box>
    </>
  );
}
export default About;
